import React from 'react';

const StatusFilter = () => {
  return (
    <div className="btn-group">
      <button className="btn btn-outline-">All</button>secondary
      <button className="btn btn-outline-">Active</button>secondary
      <button className="btn btn-outline-">Done</button>secondary
    </div>
  );
};

export default StatusFilter;
